INSERT INTO `business_sessions` VALUES (1,'2013-01-24 19:49:48','2013-01-29 17:40:19',11,'2013-01-25 19:48:00',3,'zavolat s nabídkou coagucheků',3,1),(2,'2013-01-28 18:25:19','2013-01-29 17:40:19',11,'2013-02-27 18:24:00',1,'',3,1),(3,'2013-01-30 14:19:26','2013-01-30 14:22:25',12,'2013-01-17 14:18:00',3,'17.1.13= zapomněl na nás, bere přes Orion přesto jsem mu nahlásila cenu info k dodávce a mbl; 16.1.13 = nebral tlf; odeslán email 11/10/12\r\n',2,12),(4,'2013-01-30 14:21:52','2013-01-30 14:22:31',12,'2013-01-16 14:21:00',3,'30.1.13 = zaslána obj.2x48ks16.1.13 = zasláno info na email, zapoměla na to, že proužky odebírala od nás; voláno 3/10/12 = stále obsazeno\r\n\r\n',2,2),(5,'2013-01-30 14:24:45','2013-01-30 14:24:45',12,'2013-01-16 14:24:00',3,'16.1.13=obj. 2x48ks; voláno 3/10/12 = nebrala tlf\r\n',2,4),(6,'2013-01-30 14:25:37','2013-01-30 14:25:37',12,'2013-01-16 14:25:00',3,'16.1.13 = zrovna odebrali od Roche, vysvětlila jsem úsporu při odebírání od nás a nadiktovala kontakty; tlf 29.10.- budou se obracet tlf jakmile budou proužky potřebovat\r\n',2,6),(7,'2013-01-30 14:26:14','2013-01-30 14:26:14',12,'2013-01-18 14:26:00',3,'18.1.13=volala staré tlf nedovolala se obj.u Roche, nahlásila jsem  mbl i akt.cenu a slíbila že se brzy ozve; odeslán email 11/10/12\r\n',2,7),(8,'2013-01-30 14:26:50','2013-01-30 14:26:50',12,'2013-01-16 14:26:00',1,'16.1.13=odebírají od fi kt. Má totožné ceny, zůstávají u ní; odeslán email 11/10/12\r\n',2,8),(9,'2013-01-30 14:28:40','2013-01-30 14:28:40',12,'2013-01-09 14:28:00',3,'9.1.13 - neměla kontakt Pevná linka nebyla v provozu, kontakty jsem předala, ozvou se jakmile doberou proužku od Roche, splatnost 7 dní chtějí; odeslán email 11/10/12\r\n',2,11),(10,'2013-01-30 14:31:45','2013-01-30 14:31:45',12,'2013-01-17 14:31:00',3,'17.1.13= spotřeba 48ks/2měsíce, nyní odebral od Roche, volat koncem března neb on to obj.automaticky a léta od Roche, připomenout se; odeslán email 11/10/12\r\n',2,13),(11,'2013-01-30 16:11:12','2013-01-30 16:11:24',12,'2013-01-18 16:10:00',3,'13.1.13=odebírá pro něj Mudr.Kazdová, nízká spotřeba, ozve se případně, kdyby potřebovali, dala jsem info k cená vč. Kontaktu; voláno 25/9/12 - prozatím mají zásobu, 16.11. volat',2,21),(12,'2013-01-30 16:50:11','2013-01-30 16:50:11',12,'2013-01-17 16:50:00',3,'17.1.13=mají přístroj na kompl.vyšetření, proužky užívá  jen sestra při návštěvách sem a tam, ozve se jakmile jí proužky budou docházet, dala jsem jí mbl i info k cená pro rok 2013; odeslán email 11/10/12 - spokojen, rád se obrátím na Vás při příští objednávce',2,32),(13,'2013-01-31 13:15:14','2013-02-07 15:36:22',12,'2013-01-31 13:14:00',3,'31.1.13=odeslán email s infem k cenám, 16.1.13 = chřipk.epidemie nemá na mě čas; odeslán email 11/10/12\r\n7.2.13=obj.3x48ks\r\n',2,30),(14,'2013-02-07 15:16:58','2013-02-12 15:10:01',11,'2013-02-07 10:00:00',1,'velmi milá, nabídka zasílání inkontinence se jí zalíbila, dovezeme jí 2ks předtištěných obálek, uvidíme co se z toho vyklube, ordinace velice zastaralá, neměla nejspíše ani sestru, o léčivo neměla zájem.',2,33),(15,'2013-02-07 15:25:46','2013-02-12 15:19:41',11,'2013-02-06 13:00:00',1,'mudr.působil velmi znaveně, dal nám 10min. Kdy jsme jej informovali o výhodách v inkontinenci a vybavení ordinace vše od jedné firmy, na léky v ordinaci argumentoval že vše má v baráku ale rád by zjistil zda jsme schopni dodat mu nějaké ortopedické záležitosti. slíbil zaslat emailem info co odebírá abychom mu mohli zaslat nabídku. inkontinenci říkal tak do měsíce a dvou že dá vědět, že to musí probrat s pacienty. jinak velice příjemný doktor, moc dobře ví co chce.\r\n',2,34),(16,'2013-02-07 15:32:11','2013-02-12 15:05:05',11,'2013-02-06 10:00:00',1,'Mudr.Krásová velice vitální žena, líbila se jí nabídka na službu inkontinence až domů, hl.starší lidé to uvítají, jen malinko neporozuměla systém, neměla tam sestru,takže chápu, že neměla na nás tolik času, léky v ordinaci zamítla hl.z důvodu, že by na to zapomněla, zdrav.pros. obstarává sestra, jakmile bude tak jí znovu vysvětlíme o co se jedná s poukazy na inkont. a se zdrav.prostř.',2,35),(17,'2013-02-07 15:35:35','2013-02-12 15:11:15',11,'2013-02-07 08:00:00',1,'můj omyl, je to pediatrička, nicméně jsme jí nabídli možnost vybavení spotřebního zboží do ordinace, říkala že se ozve jakmile bude něco potřebovat\r\n',2,36),(18,'2013-02-07 15:46:53','2013-02-07 15:46:53',12,'2013-01-17 15:46:00',1,'17.1.13=mají přístroj na kompl.vyšetření, proužky užívá  jen sestra při návštěvách sem a tam, ozve se jakmile jí proužky budou docházet, dala jsem jí mbl i info k cená pro rok 2013; odeslán email 11/10/12 - spokojen, rád se obrátím na Vás při příští objednávce\r\n',1,32),(19,'2013-02-07 16:41:32','2013-02-07 16:41:32',12,'2013-01-17 16:41:00',3,'nízká spotřeba, volám za měsíc s dotazem jak to vypadá a domluvení případné návštěvy u pí doktorky',2,44),(20,'2013-02-07 16:49:19','2013-02-07 16:49:19',12,'2013-01-18 16:49:00',3,'18.1.13=odebrala od jinud, posílám akt.info k cenám; odeslán email 11/10/12\r\n',2,47),(21,'2013-02-07 16:51:45','2013-02-07 16:51:45',12,'2013-01-18 16:51:00',3,'18.1.13=odebrala od jinud, posílám akt.info k cenám; odeslán email 11/10/12\r\n',2,48),(22,'2013-02-07 16:54:13','2013-02-07 16:54:13',12,'2013-01-09 16:53:00',3,'9.1.13-přechází na jiný přístroj, kt. Není na proužky; odeslán email 11/10/12\r\nLeden 2013 = objednáno 1x48ks neb nový přístroj nelze brát k pacientům! Velmi nízká spotřeba, další objednávka nejdříve za 1/2 roku sestra se znovu ozve\r\n',2,49),(23,'2013-02-12 16:00:33','2013-02-12 16:00:33',12,'2013-02-12 08:15:00',1,'12.2.13= mudr. Velice příjemná, chtěla si nás vyslechnout i když v podstatě nic nepotřebuje. Zaujala ji nabídka dodávek do ordinace spotřeb.zboží a případných bonusů. Inkontinenci nepředepisuje, ne ve tř. 2 a 3 v ordinaci, ale pro domov důchodců to má již pořešené a moment. nechce nic měnit. Spolupracuje s lékárnou kt. zavolá řekne co chce a ona jí to doveze. Nabídli jsme jí to stejné s tím, že jako distributoři můžeme navrhnout lepší cenu. Řekla nám na rychlo pár věcí, kt. odebírá (dezinfekce Dezan, injekce, špachtle, obvazy, proužky na stolici).',2,50),(24,'2013-02-12 16:32:47','2013-02-19 12:48:37',11,'2013-02-12 11:00:00',1,'12.2.13-Mudr.velmi příjemná, při nabídce se na nás ale nedívala, nejspíš přemýšlela natím, co jsme jí sdělili. Zájem má a to dost velký, líbi se jí provize líbí se jí systém na inkontinenci. Používá přístroj CoaguChek, 2x do roka, info k cenám předáno. Nechala si čas na promyšlení. Budu jí volat  19.2.2013 abych se poptala na více informací. ',1,51),(25,'2013-02-12 16:41:08','2013-02-12 16:44:13',12,'2013-02-12 11:21:00',1,'12.2.13-Mudr.velmi příjemná, rozhodně nám na rovinu sdělila,že naše nabídka pro ni není zajímavá neb má velice nízkou spotřebu a co se inkontinence týče tak i zde je to marné, neb nemá žádného pacienta na těžkou inkontinenci. Přesto to bylo příjemné setkání, Mudr. velice milá a vitální,usmívala se na nás a byla velmi zdořilá ',2,52),(28,'2013-02-19 15:12:34','2013-02-19 15:12:34',1,'2012-12-01 15:12:00',1,'',1,58),(29,'2013-02-20 14:05:34','2013-02-20 14:09:12',11,'2013-02-20 08:00:00',1,'Starší lékařka, zprvu vyděšená,\r\nposléze vyslechla nabídku s příslibem spolupráce,v ordinaci zanecháno 10 obálek na Pouk,\r\nnutná Ko za týden - případně opět vysvětlit a doladit!\r\n',1,59),(30,'2013-02-20 14:22:11','2013-02-20 14:22:11',11,'2013-02-14 09:00:00',1,'Arogantní,neochotný lékař.\r\nNabídka ho nijak neoslovila, naopak reagoval slovy: Kdo nevynese balík inkontinence do pátého patra, tak si je nezaslouží! ',1,60),(31,'2013-02-20 15:00:15','2013-02-20 15:07:25',11,'2013-02-20 09:00:00',1,'Ordinace nenavštívena. V čekárně 12 pacientů, další průběžně přicházeli. Čekal jsem do 11.hod bez úspěchu. Navštívit na konci pracovní doby, kdy bude možná méně pacientů!',1,61),(32,'2013-02-20 15:06:06','2013-02-20 15:06:06',11,'2013-02-20 11:00:00',1,'MUDr. na návštěvě u pacientů, ordinovat začne cca. ve 14 hod.\r\nNavštívit jindy!',1,62),(33,'2013-03-05 14:25:29','2013-03-05 14:25:29',12,'2013-02-13 14:25:00',3,'13.2.13=nízká spotřeba, zavolá jakmile jí dojdou, pruhy obj.sestra; odeslán email 11/10/12\r\n',2,63),(34,'2013-03-05 14:33:39','2013-03-05 14:34:03',12,'2013-01-16 14:33:00',3,'16.1.13 =  dnes obj.u své distributorky,nahlásila jsem jí naše ceny a kontakty, probere to s pí doktorkou; odeslán email 11/10/12\r\n',2,64),(35,'2013-03-05 14:41:41','2013-03-05 14:41:41',12,'2013-01-16 14:41:00',3,'16.1.13 = obj.jakmile bude potřebovat dala jsem jí akt.tlf; odeslán email 11/10/12',2,66),(36,'2013-03-05 14:54:15','2013-03-05 14:54:15',12,'2013-01-17 14:54:00',3,'17.1.13=odebrali od Roche s tím,že volali na starý tlf a nedovolali se, dala jsem jim mbl a info k akt.ceně, příště se ozvou; 16.1.13 = nebrala tlf \r\n',2,68),(37,'2013-03-07 22:29:08','2013-03-07 22:29:08',11,'2013-03-07 13:00:00',1,'návštěva v ordinaci na doporučení REP z f.KRKA p.Šmída.\r\nLékařka vstřícná, informovaná. Předány obálky, začne spolupracovat. ',1,101),(38,'2013-04-03 15:32:26','2013-04-03 15:32:26',12,'2013-03-25 12:30:00',1,'dovoz CoaguCheku + nabídka spolupráce.\r\nNakupuje přes Omniprax\r\n- CRP Orion proužky\r\n',1,44),(39,'2013-04-03 15:54:53','2013-04-03 15:54:53',12,'2013-04-02 10:00:00',1,'nabídka spolupráce\r\n- nakupuje převážně v Omnipaxu a Mediplusu\r\n- zrcátka přes PL Albi cena cca 4,5 vč. DPH\r\n- nabídka na Gel (keli?), dezinfekce, rukavice - Optiline vinyl, nepudrovaný',1,109);
